import React, { useState, useEffect } from 'react';
import Empty from "./EmptyComp";

export default function LoggingIn(props) {

    const [name, setName] = useState('Empty');
    const [email, setEmail] = useState('Empty');

    useEffect(()=>{
        console.log("NO DEPENDACI")

    },[])

    useEffect(()=>{
        console.log("EMPTY VALA")

    },)

    useEffect(() => {
        console.log("USE EFFECT -> " +name)

    },[name]);

    useEffect(() => {
        console.log("USE EFFECT -> " +email)

    },[email]);

    useEffect(() => {
        return () => {
            console.log("This is unmounted");
        };
    }, []);


    let count = 0;
    let change = false;

    if(change === false){

        return(
            <div>

                <h1>{name}</h1>
                <h1>{email}</h1>

                <button onClick={()=>{
                    count++;
                    setName("zeerak" + count)
                }}>Update Name</button>

                <button onClick={()=>{
                    count++;
                    setName("Email" + count)
                }}>Update Email</button>

                <button onClick={()=>{
                    change = true
                }}>Change COMP</button>

            </div>
        );

    }
    else{
        return(
            <div>
                <Empty/>
            </div>
        )
    }



}
